import React from "react";
import { Link, Route, Routes } from "react-router-dom";
import styles from './phoneRepair.module.css';
import PhoneModel from "../PhoneModel/PhoneModel";
import Aux from "../../../../Hoc/Aux/Aux";
import AuthContext from "../../../../Hoc/Authcontext/auth-context";
import { Component } from "react/cjs/react.production.min";


class phoneRepair extends Component {

    render () {
        console.log(this.props.model);



        return (
            <Aux>
                <AuthContext.Provider value={this.props.model}>
                    <PhoneModel />
                </AuthContext.Provider>

                <Link to="/phone/iPhone"/>
                <div className={styles.Main} >
                    <img src={this.props.img} />
                    <p>{this.props.model}</p>
                </div>
            </Aux>
        )

    }
} 

export default phoneRepair;
